import React, { Component } from "react";

class Navbar extends Component {
  render() {
    return (
      <nav class="uk-navbar-container" uk-navbar>
        <div class="uk-navbar-justify">
          <ul class="uk-navbar-nav">
            <li class="uk-active">
              <a href="#">Active</a>
            </li>
            <li>
              <a href="#">Item</a>
            </li>
          </ul>
        </div>
      </nav>
    );
  }
}

export default Navbar;
